import React from 'react'
import Navbar from '../components/Navbar'
import Footer from '../components/Footer'
import Banner from '../components/Banner'
import CarCard from '../components/CarCard'
import NavbarLoggedIn from '../components/NavbarLoggedin'
import FooterLoggedIn from '../components/FooterLoggedIn'
import { makeStyles } from '@material-ui/core/styles';
import MenuItem from '@material-ui/core/MenuItem';
import FormHelperText from '@material-ui/core/FormHelperText';
import FormControl from '@material-ui/core/FormControl';
import { withStyles } from '@material-ui/core/styles';
import Select from '@material-ui/core/Select';

const OurModels = () => {

    var AuthNavbar = '';
    var AuthFooter = '';

if(localStorage.getItem('auth_token'))

{

    AuthNavbar = (
     <NavbarLoggedIn/>
                );

    AuthFooter = (
     <FooterLoggedIn/>
                );


} else {

  AuthNavbar = (
     <Navbar/>
                );

    AuthFooter = (
     <Footer/>
                );            

    
}



const StyledSelect = withStyles({
  root: {
    background: '#171717',
    borderRadius: 3,
    border: 0,
    color: 'white',
    height: 'auto',
    padding: '10px',
    boxShadow: '0px 5px 8px $primary_color',
    hover: 'none'
  },
  label: {
    textTransform: 'capitalize',
  },
})(Select);




















const StyledFormControl = withStyles({
  root: {
    background: '#171717',
    borderRadius: 3,
    border: 0,
    color: 'white',
    height: 'auto',
    padding: '10px',
    boxShadow: '0px 5px 8px $primary_color',
    hover: 'none'
  },
  





  label: {
    textTransform: 'capitalize',
  },
   outlinedPrimary: {
      background: '#171717',
    '&:hover': { background: '#171717'},
  },

outlined: {
     background: '#171717',
    '&$disabled': {  background: '#171717', },
  },
  
  
  







})(FormControl);


const StyledFormHelperText = withStyles({
  root: {
    background: 'transparent',
    borderRadius: 3,
    border: 0,
    color: 'white',
    height: 'auto',
    padding: '10px',
    boxShadow: '0px 5px 8px $primary_color',
    hover: 'none',
    fontSize: '18px',
  },
  label: {
    textTransform: 'capitalize',
  },
})(FormHelperText);



const StyledMenuItem = withStyles({
  root: {
    background: '#171717',
    borderRadius: 3,
    color: 'white',
    height: 'auto',
    padding: '10px',
    boxShadow: '0px 5px 8px $primary_color',
    fontSize: '18px',
    '&:focus': {
      backgroundColor: "#9c1a1a",
      '& .MuiListItemIcon-root, & .MuiListItemText-primary': {
        color: "white",
      },
    },
  },
   outlinedPrimary: {
      background: '#171717',
    '&:hover': { background: '#171717'},
  },

outlined: {
     background: '#171717',
    '&$disabled': {  background: '#171717', },
  },






  label: {
    textTransform: 'capitalize',
  },
})(MenuItem);
















const useStyles = makeStyles((theme) => ({
  formControl: {
    margin: theme.spacing(1),
    minWidth: 120,
    boxShadow: "none",
  },
  selectEmpty: {
    marginTop: theme.spacing(2),
  },
}));



const classes = useStyles();
  const [value, setValue] = React.useState('');

  const handleChange = (event) => {
    setValue(event.target.value);
  };



  return (
    <div>
      <div className="empty_space"></div>
      {AuthNavbar}
      <Banner title="Modelljeink" />

      <div className="filter_container">
        <form>

      <StyledFormControl className={classes.formControl}>
        <StyledSelect
          value={value}
          onChange={handleChange}
          displayEmpty
          className={classes.selectEmpty}
          inputProps={{ 'aria-label': 'Without label' }}
        >
          <StyledMenuItem value={"Sedan"}>Sedan</StyledMenuItem>
          <StyledMenuItem value={"Hibrid"}>Hibrid</StyledMenuItem>
          <StyledMenuItem value={"Furgon"}>Furgon</StyledMenuItem>
          <StyledMenuItem value={"Kombi"}>Kombi</StyledMenuItem>
        </StyledSelect>
        <StyledFormHelperText>Válasszon kategóriát!</StyledFormHelperText>
      </StyledFormControl>




      </form>
      
      </div>


      <div className="car_card_container">
      <CarCard />
      <CarCard />
      <CarCard />
      </div>



      {AuthFooter}


    </div>
  )
}

export default OurModels
